import Header from "../../components/header/Header";
import "./style.css";

const Friends = () => {
  return (
    <>
      <Header page="friends" />
      <div className="friends">
        <div className="friends_left">
          <div className="friends_left_header">
            <h2>Friends</h2>
            <div className="small_circle">
              <div className="settings_filled_icon"></div>
            </div>
          </div>

          <div className="menu_item hover3 active_friends ">
            <div className="small_circle" style={{ background: "#1876f2" }}>
              <i className="friends_home_icon invert "></i>
            </div>
            <span>Home</span>
          </div>
        </div>
        <div className="friends_right"></div>
      </div>
    </>
  );
};

export default Friends;
